import React from 'react';
import { NavLink } from 'react-router-dom';
import '../css/navbar.css'


const Navbar = () => {
    return (
        < >
            <Nav>
                <NavLink to="/">
                    <h1>Logo</h1>
                </NavLink>
                <Bars />
                <NavMenu>
                    <NavLink to="/about" activeStyle>
                        About
                    </NavLink>
                </NavMenu>
            </Nav>   
        </ >
    )
}

export default Navbar;
